        <Travel destination='londre' contry='ANg' photo ='https://www.salaun-holidays.com/images/concours-carnet-de-voyages.jpg' alt='https://www.salaun-holidays.com/images/concours-carnet-de-voyages.jpg' distance='5'/>
      </div>
    );
  }
}

export default App;
